<template>
  <!-- :pagination="{
      el: '.pagination',
      type: 'bullets'
    }" -->
  <swiper
    @swiper="onSwiper"
    @slideChange="onSlideChange"
    :navigation="{
      nextEl: '.next',
      prevEl: '.prev'
    }"
    :pagination="pagination"
    :autoplay="false"
    :modules="[Navigation, Pagination, Autoplay]"
  >
    <swiper-slide><img src="../assets/img/1.jpg" alt="1.jpg" /></swiper-slide>
    <swiper-slide><img src="../assets/img/2.jpg" alt="2.jpg" /></swiper-slide>
    <swiper-slide><img src="../assets/img/3.jpg" alt="3.jpg" /></swiper-slide>
    <swiper-slide><img src="../assets/img/4.jpg" alt="4.jpg" /></swiper-slide>
    <swiper-slide><img src="../assets/img/5.jpg" alt="5.jpg" /></swiper-slide>
    <div class="pagination" id="pagination">
      <template v-for="(item, index) in paginationsIcon" :key="item">
        <span><img :src="item" alt="" :value="index" /></span>
      </template>
    </div>
    <div class="prev">prev</div>
    <div class="next">next</div>
  </swiper>
</template>

<script setup lang="ts">
import { Swiper, SwiperSlide } from 'swiper/vue'
import 'swiper/css'
import 'swiper/css/navigation'
import 'swiper/css/pagination'
import { Navigation, Pagination, Autoplay } from 'swiper'
import { onMounted, ref } from 'vue'
import type { PaginationOptions } from 'swiper/types'

let mySwiper: any = ref()
const onSwiper = (swiper: any) => {
  // console.log(swiper)
  mySwiper.value = swiper
}

const paginationsIcon = ref<string[]>([
  'https://uploadstatic.mihoyo.com/puzzle/upload/puzzle/2022/09/23/49b0d4edaff8696180b04b2cb18eca76_8159614929720420543.png',
  'https://uploadstatic.mihoyo.com/puzzle/upload/puzzle/2022/09/23/7d35c07fac5ed145b3429164f1bc51fa_888370857059316630.png',
  'https://uploadstatic.mihoyo.com/puzzle/upload/puzzle/2022/09/23/cca3e4d75acc7d5974aa60f51e2fd6b9_8165144317195169263.png',
  'https://uploadstatic.mihoyo.com/puzzle/upload/puzzle/2022/09/23/3644b28e3f4cb2e9af541a31ec4619df_1924560429513453825.png',
  'https://uploadstatic.mihoyo.com/puzzle/upload/puzzle/2022/09/23/31d2ae72de15c1b558f4c7d9319a0974_783869415668509656.png'
])
const paginationsIconSel = ref<string[]>([
  'https://uploadstatic.mihoyo.com/puzzle/upload/puzzle/2022/09/23/d636a0b0981878d7f16d763cff67948d_8379394089171599598.png',
  'data:image/webp;base64,',
  'data:image/webp;base64,',
  'data:image/webp;base64,',
  'data:image/webp;base64,'
])
let res: any = null
const pagination = ref<PaginationOptions>({
  el: '.pagination',
  clickable: true,
  type: 'custom',

  renderCustom: function (swiper: any, current: number) {
    if (res === null) res = document.getElementById('pagination')?.innerHTML
    // console.log(res)
    let temp = res.split('</span>')
    let temp2 = temp[current - 1].split('=')

    temp2[3] = paginationsIconSel.value[current - 1] + ' alt'
    temp2 = temp2.join('=')
    temp[current - 1] = temp2
    temp = temp.join('</span>')
    return temp
  }
})

function getPageIcon() {
  let paginationHtml = document.getElementById('pagination')?.getElementsByTagName('img') as any
  // console.log(paginationHtml)
  for (let i = 0; i < paginationHtml.length; i++) {
    paginationHtml[i].onclick = function () {
      mySwiper.value.slideTo(i)
    }
  }
}

onMounted(() => {
  getPageIcon()
})

const onSlideChange = () => {
  getPageIcon()
}
</script>

<style scoped lang="less">
