  .pagination {
    position: absolute;
    // text-align: center;
    transition: 0.3s opacity;
    transform: translate3d(0, 0, 0);
    z-index: 10;
    justify-content: center;
    display: flex;
    :deep(img) {
      width: 40px;
      height: 40px;
    }
  }
  .prev {
    position: absolute;
    top: var(--swiper-navigation-top-offset, 50%);
    width: 44px;
    height: 44px;
    margin-top: calc(0px - (var(--swiper-navigation-size) / 2));
    z-index: 10;
    cursor: pointer;
    display: flex;
    align-items: center;
    justify-content: center;
    color: var(--swiper-navigation-color, var(--swiper-theme-color));
    left: 30px;
    right: auto;
  }
  .next {
    position: absolute;
    top: var(--swiper-navigation-top-offset, 50%);
    width: 44px;
    height: 44px;
    margin-top: calc(0px - (var(--swiper-navigation-size) / 2));
    z-index: 10;
    cursor: pointer;
    display: flex;
    align-items: center;
    justify-content: center;
    color: var(--swiper-navigation-color, var(--swiper-theme-color));
    left: auto;
    right: 100px;
  }
}

.swiper-slide {
  text-align: center;
  font-size: 18px;

  /* Center slide text vertically */
  display: flex;
